COSBase cosBase = acquireItem( j );
if (cosBase instanceof COSInteger)
{
    COSInteger cosInteger = (COSInteger)cosBase;
    result[j] = cosInteger.intContent();
}
else if (cosBase instanceof COSFloat)
{
    COSFloat cosFloat = (COSFloat)cosBase;
    result[j] = cosFloat.floatContent();
}
else if (cosBase instanceof COSNumeral)
{
    COSNumeral cosNumeral = (COSNumeral)cosBase;
    result[j] = cosNumeral.floatContent();
}

